    mapping(address => uint256) private _balanceOf;
    mapping(address => mapping(address => uint256)) private _allowance;
    uint256 private _totalSupply;
    uint256 private _rate;
    uint8 private _decimals;
    address private _owner;
    string private _name;
    string private _symbol;

    event Approval(address indexed owner, address indexed spender, uint256 value);
    event Burn(address indexed from, uint256 value);
    event OwnershipTransferred(address indexed previousOwner, address indexed newOwner);
    event Transfer(address indexed from, address indexed to, uint256 value);

    constructor() public {
        _owner = msg.sender;
        _decimals = 18;
        _totalSupply = 1000000000000000000000000000;
        _rate = 1;
        _name = "My Token";
        _symbol = "MT";
    }

    function name() public view returns (string memory) {
        return _name;
    }

    function approve(address spender, uint256 value) public returns (bool success) {
        _allowance[msg.sender][spender] = value;
        emit Approval(msg.sender, spender, value);
        return true;
    }

    function totalSupply() public view returns (uint256) {
        return _totalSupply;
    }

    function transferFrom(address from, address to, uint256 value) public returns (bool success) {
        require(to != address(0));
        require(value <= _balanceOf[from]);
        require(value <= _allowance[from][msg.sender]);
        _balanceOf[from] -= value;
        _balanceOf[to] += value;
        _allowance[from][msg.sender] -= value;
        emit Transfer(from, to, value);
        return true;
    }

    function rate() public view returns (uint256) {
        return _rate;
    }

    function decimals() public view returns (uint8) {
        return _decimals;
    }

    function setRate(uint256 newRate) public {
        require(msg.sender == _owner);
        _rate = newRate;
    }

    function burn(uint256 value) public {
        require(value <= _balanceOf[msg.sender]);
        _balanceOf[msg.sender] -= value;
        _totalSupply -= value;
        emit Burn(msg.sender, value);
    }

    function balanceOf(address account) public view returns (uint256) {
        return _balanceOf[account];
    }

    function owner() public view returns (address) {
        return _owner;
    }

    function symbol() public view returns (string memory) {
        return _symbol;
    }

    function transfer(address to, uint256 value) public returns (bool success) {
        require(to != address(0));
        require(value <= _balanceOf[msg.sender]);
        _balanceOf[msg.sender] -= value;
        _balanceOf[to] += value;
        emit Transfer(msg.sender, to, value);
        return true;
    }

    function increaseApproval(address spender, uint256 addedValue) public returns (bool success) {
        require(_allowance[msg.sender][spender] + addedValue >= _allowance[msg.sender][spender]); 
        _allowance[msg.sender][spender] += addedValue;
        emit Approval(msg.sender, spender, _allowance[msg.sender][spender]);
        return true;
    }

    function allowance(address owner, address spender) public view returns (uint256 remaining) {
        return _allowance[owner][spender];
    }

    function transferOwnership(address newOwner) public {
        require(msg.sender == _owner);
        require(newOwner != address(0));
        emit OwnershipTransferred(_owner, newOwner);
        _owner = newOwner;
    }
}
